// programm.js

import React, { useEffect, useState } from "react";
import Navbar from "./navbar";
import Footer from "./footer";
import "../styles/Program.css";

// Helper function to get CSRF token from cookies
function getCookie(name) {
  let cookieValue = null;
  if (document.cookie && document.cookie !== '') {
    const cookies = document.cookie.split(';');
    for (let i = 0; i < cookies.length; i++) {
      const cookie = cookies[i].trim();
      // Does this cookie string begin with the name we want?
      if (cookie.substring(0, name.length + 1) === (name + '=')) {
        cookieValue = decodeURIComponent(cookie.substring(name.length + 1));
        break;
      }
    }
  }
  return cookieValue;
}

function Programm() {
  const [programs, setPrograms] = useState([]);
  const [selectedProgram, setSelectedProgram] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);

  // Fetch data from Django backend
  useEffect(() => {
    const fetchPrograms = async () => {
      try {
        const response = await fetch("http://localhost:8000/program/programs/", {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
          },
        });

        const data = await response.json();
        setPrograms(data);
      } catch (error) {
        console.error("Error fetching programs:", error);
      }
    };

    fetchPrograms();
  }, []);

  // Enroll user in a program
  const handleEnroll = async (programId) => {
    const csrftoken = getCookie('csrftoken'); // Get CSRF token from cookies

    const confirmed = window.confirm("Are you sure you want to enroll?");
    if (!confirmed) return;

    try {
      const response = await fetch(`http://localhost:8000/program/enroll/${programId}/`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          "X-CSRFToken": csrftoken, // Add CSRF token to headers
        },
      });

      if (response.ok) {
        alert("You have successfully enrolled!");
      } else {
        const data = await response.json();
        if (data.message === "Program already enrolled") {
          alert("You have already enrolled in this program.");
        } else {
          alert("Enrollment failed. Please try again.");
        }
      }
    } catch (error) {
      console.error("Error enrolling in program:", error);
      alert("An error occurred. Please try again.");
    }
  };

  // Open modal with selected program details
  const openModal = (program) => {
    setSelectedProgram(program);
    setIsModalOpen(true);
  };

  // Close modal
  const closeModal = () => {
    setSelectedProgram(null);
    setIsModalOpen(false);
  };

  return (
    <>
      <Navbar />

      <div className="program-container">
        <h1>Our Fitness Programs</h1>
        <div className="program-list">
          {programs.map((program, index) => (
            <div
              key={program.id}
              className={`program-card ${
                index % 2 === 0 ? "left-image" : "right-image"
              }`} // Conditional class based on index
            >
              <img
                src={`http://127.0.0.1:8000/media/${program.programm_img}`}
                alt={program.programm_name}
                className="program-image"
              />
              <div className="program-info">
                <h2 className="program-title">{program.programm_name}</h2>
                <p className="program-description">{program.description}</p>
                <button className="enroll-btn" onClick={() => handleEnroll(program.id)}>
                  Enroll
                </button>
              </div>
              <button className="arrow-btn" onClick={() => openModal(program)}>
                {index % 2 === 0 ? ">" : "<"}
              </button>
            </div>
          ))}
        </div>
      </div>

      {/* Modal for program details */}
      {isModalOpen && selectedProgram && (
        <div className="modal-overlay">
          <div className="modal-content">
            <span className="close-btn" onClick={closeModal}>
              &times;
            </span>
            <img
              src={`http://127.0.0.1:8000/media/${selectedProgram.programm_img}`}
              alt={selectedProgram.programm_name}
              className="modal-image"
            />
            <div className="modal-info">
              <h2>{selectedProgram.programm_name}</h2>
              <p>{selectedProgram.description}</p>
              <p>
                <strong>Key Features:</strong> {selectedProgram.key_features}
              </p>
              <p>
                <strong>Work Includes:</strong> {selectedProgram.work_include}
              </p>
              <p>
                <strong>Examples:</strong> {selectedProgram.example}
              </p>
            </div>
          </div>
        </div>
      )}

      <Footer />
    </>
  );
}

export default Programm;
